import React, { useState, useEffect } from 'react';
import { AppBar, Toolbar, Typography, Button, Chip } from '@mui/material';
import { Link } from 'react-router-dom';

const Navbar = () => {
  // demo
  const [user, setUser] = useState({ name: "TEST", credits: 150 });

  // zde načítat data uživatele z API
  useEffect(() => {
    setUser({ name: "TEST", credits: 150 });
  }, []);

  return (
    <AppBar position="static">
      <Toolbar style={{ justifyContent: 'space-between' }}>
        {/* Levá část navigace */}
        <Typography variant="h6">
          GymNest
        </Typography>

        {/* Prázdný Box pro zarovnání doprostřed */}
        <Box style={{ flexGrow: 1 }} />

        {/* Informace o uživateli umístěné doprostřed */}
        {user && (
          <Box style={{ flexGrow: 1, display: 'flex', justifyContent: 'center' }}>
            <Typography color="inherit">{user.name}</Typography>
            <Chip label={`Kredity: ${user.credits}`} color="secondary" style={{ marginLeft: 10 }} />
          </Box>
        )}

        <Box style={{ flexGrow: 1 }} />

        {/* Pravá část navigace */}
        <Button color="inherit" component={Link} to="/">Domů</Button>
        <Button color="inherit" component={Link} to="/akce">Akce</Button>
        <Button color="inherit" component={Link} to="/clenstvi">Členství</Button>
        <Button color="inherit" component={Link} to="/rozvrhy">Rozvrhy</Button>
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
